import "./App.css";
import "./index.css";
import posterOne from "./images/poster1.jpg";
import posterTwo from "./images/poster2.jpg";
import posterThree from "./images/poster3.jpg";

function App() {
  return (
    <div className="App">
      <a href="#">
        <img src={posterOne} alt="posterOne" />
      </a>
      <a href="#">
        <img src={posterTwo} alt="posterTwo" />
      </a>
      <a href="#">
        <img src={posterThree} alt="posterThree" />
      </a>
      <p>
        Lorem ipsum dolor sit amet consectetur adipisicing elit. Sed ex officiis
        obcaecati ut cum eaque itaque earum dolor id incidunt, placeat velit
        tempora. Expedita qui, architecto et modi illum voluptate.
      </p>
    </div>
  );
}

export default App;
